INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, "調子が上がって\nきたなっ", 2, 2, 1, "vo_minigame_1013_icon_1_002_001", 3000, "vo_minigame_1013_icon_2_002_001", "訓練はまだ\nここからですわ", 1000);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, "ほらほら、\nまだいけるだろ？", 2, 2, 2, "vo_minigame_1013_icon_1_003_001", 3000, "vo_minigame_1013_icon_2_003_001", "クスクス、悪くない\n流れですわね", 5000);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, "へへっ、おまえら\nやるじゃねえか！", 3, 2, 3, "vo_minigame_1013_icon_1_004_001", 3000, "vo_minigame_1013_icon_2_004_001", "すばらしい\n記録ですわ", 10000);
