INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, "うおぉぉっ！\n絶好調だぜ！", 3, 2, 6, "vo_minigame_1013_icon_1_005_003", 3000, "vo_minigame_1013_icon_2_005_003", "エリコ班の\n本領発揮ですわ！", 10000);
